(window.webpackJsonp=window.webpackJsonp||[]).push([[307],{662:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1253-tiem-xung-đe-quoc"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1253-tiem-xung-đe-quoc"}},[n._v("#")]),n._v(" Chương 1253: Tiềm Xung đế quốc")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1253: Tiềm Xung đế quốc"),t("br"),t("br"),n._v("“Ta đi cẩn thận nghiên cứu một chút, ngươi trước dựa theo cho lúc trước ngươi giảng giải phương pháp tu luyện!”"),t("br"),t("br"),n._v("Nhận lấy tinh huyết, ánh mắt sáng lên, Trương Huyền lập tức dùng chân khí bọc, xoay người đi vào gian phòng của mình."),t("br"),t("br"),n._v("Bàn tay một trảo, sắp đặt ra một cái cách âm đoạn giới, trực tiếp đi vào Thiên Nghĩ Phong sào."),t("br"),t("br"),n._v("Nghiên cứu cái này, cần tuyệt đối yên tĩnh, ở đây an toàn nhất."),t("br"),t("br"),n._v("Tìm địa phương ngồi xuống, đem Trương Cửu Tiêu tinh huyết, lơ lửng tại trước mặt, ngón tay một điểm, đầu ngón tay cũng bay ra một giọt, hướng đối phương tới gần."),t("br"),t("br"),n._v("“Không có bất kỳ cái gì khớp... Nhìn tới, ta cũng không phải là Thánh Nhân Trương gia...”"),t("br"),t("br"),n._v("Cẩn thận quan sát, một lát sau, Trương Huyền bất đắc dĩ lắc đầu."),t("br"),t("br"),n._v("Căn cứ hắn dò xét, Trương Cửu Tiêu giọt máu này, cùng trong cơ thể hắn huyết dịch, không có chút nào khớp... Nói cách khác, hắn trùng sinh đoạt xá thân thể này, cùng Thánh Nhân Trương gia, không có nửa xu quan hệ."),t("br"),t("br"),n._v("Nhìn tới... Suy nghĩ nhiều!"),t("br"),t("br"),n._v("“Không phải Trương gia người, lại trúng Tiên Thiên thai độc... Đây rốt cuộc là vị nào độc sư, thật là rảnh rỗi...”"),t("br"),t("br"),n._v("Lợi hại như vậy độc sư, chạy đến Thiên Huyền vương quốc loại địa phương nhỏ này, cho một cái không biết tên tiểu gia hỏa hạ độc... Thật sự là có bệnh."),t("br"),t("br"),n._v("Bất quá, có phải hay không Trương gia người, đối với hắn mà nói đều không có ảnh hưởng."),t("br"),t("br"),n._v("Nếu như là... Cùng lắm thì về sau gặp được vị nào cùng Lạc Nhược Hi thông gia thiên tài, có thể ít đánh một trận... Không phải, cũng đừng trách không lưu tình."),t("br"),t("br"),n._v("“Tấn thăng huyết mạch, quả thực khó mà làm được...”"),t("br"),t("br"),n._v("Biết mình không phải Trương gia người, lại nghiên cứu một hồi, phát hiện muốn cho huyết mạch tấn thăng, thực sự quá khó, gần như không có khả năng hoàn thành, Trương Huyền giật mình."),t("br"),t("br"),n._v("Cũng đúng, nếu là tốt như vậy tấn thăng, đoán chừng nhiều năm như vậy, người người đều thành hạch tâm."),t("br"),t("br"),n._v("Rời khỏi Thiên Nghĩ Phong sào phía trước, nghĩ đến thực lực của mình chợt tăng không ít, ngay sau đó một mặt tự tin tìm phân thân chiến đấu, không có ngoài ý muốn, lần nữa bị đánh mặt mũi máu tươi, suýt chút nữa chết."),t("br"),t("br"),n._v("Cùng những người khác so, cùng cấp bậc có thể nói vô địch, nhưng cùng phân thân so, cùng cấp bậc... Vẫn là kém rất lớn một đoạn."),t("br"),t("br"),n._v("Suy nghĩ một chút liền tràn đầy tâm tắc."),t("br"),t("br"),n._v("Trở lại lưng thú, tiếp tục cho Trương Cửu Tiêu chỉ điểm."),t("br"),t("br"),n._v("Không hổ là Trương gia thiên tài, cứ việc huyết mạch độ tinh thuần không đủ, thiên phú lại là không thể nói, năng lực học tập, so với Huyền Huyền hội thành viên mạnh mẽ quá nhiều."),t("br"),t("br"),n._v("Ngắn ngủi sáu ngày công phu, cả người giống như là thoát thai hoán cốt, cứ việc vẫn như cũ là Nguyên Thần cảnh trung kỳ, nhưng mà đơn đả độc đấu lời nói, cái kia hai cái dự thính sống, chưa hẳn có thể là đối thủ."),t("br"),t("br"),n._v("“Chỉ điểm của hắn... Thẳng vào chỗ yếu hại, rất nhiều chi tiết, liền xem như ta, cũng chưa chắc phát hiện...”"),t("br"),t("br"),n._v("Ngón tay giữa điểm nhìn ở trong mắt, Triệu Hưng Mặc tràn đầy khiếp sợ."),t("br"),t("br"),n._v("Trương Cửu Tiêu một chút thiếu hụt sơ hở, liền xem như hắn, đều không có nhìn ra, đối phương lại tính nhắm vào chỉ điểm, mảy may không sai, phần này nhãn lực, có thể nói kinh khủng!"),t("br"),t("br"),n._v("Khó trách có thể xông đường thành công, nhãn lực phối hợp thêm tâm cảnh... Vị này Trương Huyền, về sau đi vào Thánh tử điện, đều có thể trổ hết tài năng, rực rỡ hào quang."),t("br"),t("br"),n._v("“Tiềm Xung đế quốc đến...”"),t("br"),t("br"),n._v("Phi hành đến ngày thứ bảy, một cái thành phố khổng lồ xuất hiện ở trước mắt."),t("br"),t("br"),n._v("“Dựa theo thời gian suy tính, đế quốc khác tuyển chọn người, nên đều đến, trực tiếp đi Danh Sư đường đi!”"),t("br"),t("br"),n._v("Đứng tại cửa sổ trước mặt, Triệu Hưng Mặc nói."),t("br"),t("br"),n._v("Đi trên đường, Trương Huyền cũng biết, vị này Triệu sư, phụ trách bát đại phong hào đế quốc phạm vi bên trong nhân viên tuyển chọn, cái khác mấy cái đế quốc, đều sớm đi, cuối cùng mới tới Thanh Nguyên đế quốc."),t("br"),t("br"),n._v("Trước đó khảo hạch qua, lúc này đã tự mình tới nơi này, tính toán thời gian, đều không khác mấy đến, có thể tiến hành thi vòng hai."),t("br"),t("br"),n._v("“Không biết... Hiện tại thông qua lần đầu thử nghiệm khảo hạch có bao nhiêu? Thi vòng hai lại muốn chọn rút ra bao nhiêu người?”"),t("br"),t("br"),n._v("Trương Huyền nhìn qua."),t("br"),t("br"),n._v("“Tiềm Xung đế quốc là ba cái danh ngạch, cái khác ba cái mạnh một chút phong hào đế quốc hai cái, Sùng Viễn đế quốc, Thiên Vân đế quốc... Cùng các ngươi Thanh Nguyên, đều chỉ có một cái, bởi vậy, tám đại đế quốc cộng lại, tổng cộng là mười ba cái! Bát đại phong hào đế quốc phạm vi bên trong, còn có mười đại tam đẳng Thánh Nhân quý tộc... Mỗi một cái đều có hai cái danh ngạch, cho nên... Tính gộp lại, tổng cộng có ba mươi ba người, thi vòng hai về sau, còn lại hai mươi!”"),t("br"),t("br"),n._v("Triệu Hưng Mặc nói."),t("br"),t("br"),n._v("“Còn tốt!”"),t("br"),t("br"),n._v("Trương Huyền thở phào nhẹ nhõm."),t("br"),t("br"),n._v("Ba mươi ba thông qua hai mươi cái, số lượng đã vượt qua hơn phân nửa, nên không tính là quá khó."),t("br"),t("br"),n._v("“Không nên cảm thấy tỉ lệ cao, liền xem thường, có thể đi vào cái này ba mươi ba cái danh ngạch, không có chỗ nào mà không phải là thiên tài trong thiên tài, cường giả bên trong cường giả, muốn từ trong bọn họ trổ hết tài năng... Độ khó bao lớn, có thể tưởng tượng được!”"),t("br"),t("br"),n._v("Thấy hắn biểu lộ thả lỏng, Triệu Hưng Mặc nhịn không được nói."),t("br"),t("br"),n._v("Thanh Nguyên đế quốc, không nhiều là phong hào trong đế quốc yếu nhất một cái, tại đây cái đế quốc tài năng xuất chúng, thi vòng hai bên trong chưa hẳn có khả năng chiếm được tiện nghi."),t("br"),t("br"),n._v("“Thực lực của ngươi, tại Nguyên Thần cảnh trung kỳ vô địch, ta đều không thể thắng được, nhưng Thánh tử điện yêu cầu là, không đến ba mươi tuổi danh sư... Có chút lợi hại thiên tài, đã đạt đến Xuất Khiếu cảnh! Nói cách khác, các ngươi đối mặt, cũng không phải là đơn thuần Nguyên Thần cảnh cao thủ.”"),t("br"),t("br"),n._v("“Xuất Khiếu cảnh?”"),t("br"),t("br"),n._v("“Đúng vậy a, Tiềm Xung đế quốc liền có một vị thiên tài đạt đến Xuất Khiếu cảnh, mặc dù không có đi qua lôi kiếp, nhưng cũng sức chiến đấu mạnh mẽ! Thánh Nhân quý tộc bên trong, cũng có mấy vị đạt đến loại cảnh giới này, bọn họ mới thật sự là cường giả.”"),t("br"),t("br"),n._v("Triệu Hưng Mặc gật đầu."),t("br"),t("br"),n._v("Trước mắt vị này, cùng cấp bậc quả thực mạnh mẽ, có thể... Đối mặt, cũng không phải là tương đồng cấp bậc, hơn nữa, đối phương cũng không có khả năng đem tu vi áp chế đến Nguyên Thần cảnh trung kỳ, lại cùng ngươi chiến đấu..."),t("br"),t("br"),n._v("Cho nên, muốn theo ba mươi ba người bên trong, trổ hết tài năng, cũng không phải là tưởng tượng đơn giản như vậy."),t("br"),t("br"),n._v("“Binh tới tướng đỡ, nước tới đất ngăn đi!” Trương Huyền thản nhiên nói."),t("br"),n._v(" Nói chưa dứt lời, nói chuyện, chẳng những không có khẩn trương, chẳng biết tại sao, ngược lại mang theo hưng phấn."),t("br"),t("br"),n._v("Thực lực của hắn bây giờ, cứ việc chỉ là Nguyên Thần cảnh trung kỳ, nhưng sức chiến đấu đã có thể so với Xuất Khiếu cảnh hậu kỳ, trước đó cùng Triệu Hưng Mặc thời điểm chiến đấu, sợ ra tay quá nặng, chỉ dùng không đến một phần năm lực lượng... Nếu là những này tham dự khảo hạch người, thực lực đủ mạnh, cũng là có thể chơi bên trên một chơi."),t("br"),t("br"),n._v("Thấy bộ dáng này, biết đem lời của mình, vào tai này ra tai kia, Triệu Hưng Mặc lắc đầu, không nói thêm lời, dưới thân Thánh thú, bỗng nhiên nhoáng một cái, thẳng tắp hướng trước mắt to lớn thành phố bao la bay đi."),t("br"),t("br"),n._v("Chỉ chốc lát, Tiềm Xung đế quốc Danh Sư đường, xuất hiện ở trước mắt."),t("br"),t("br"),n._v("Ở phía trước quảng trường chậm rãi hạ xuống, đám người vừa ra trên mặt đất, liền thấy mấy vị lão giả tiến lên đón."),t("br"),t("br"),n._v("“Triệu sư...”"),t("br"),t("br"),n._v("Đi đầu một cái, sáu mươi tuổi khoảng chừng, mặt trắng không râu, hai hàng lông mày nghiêng dựng thẳng, một thân trường bào màu xanh, khí thế mười phần."),t("br"),t("br"),n._v("Minh Lý Chi Nhãn vận chuyển, Trương Huyền lặng lẽ nhìn lại, chỉ thấy thực lực của đối phương, đã vượt qua Xuất Khiếu cảnh, đạt đến nửa bước lĩnh vực cấp bậc!"),t("br"),t("br"),n._v("Còn lại mấy vị, tu vi cũng không yếu, cùng trước đó Tống Hiên không kém bao nhiêu, đều là Xuất Khiếu cảnh cường giả đỉnh phong."),t("br"),t("br"),n._v("Không hổ là thứ nhất phong hào đế quốc, đơn mấy vị này, liền có thể tuỳ tiện để Thanh Nguyên đế quốc, thay đổi triều đại, không có sức phản kháng."),t("br"),t("br"),n._v("Lên tiếng, Triệu Hưng Mặc cùng trước đó mới vừa nhìn thấy lúc đồng dạng, mặt không hề cảm xúc: “Nhạc đường chủ, hai vị này là Thanh Nguyên đế quốc tuyển ra Trương Huyền Trương sư, cùng Trương Cửu Tiêu Trương sư!”"),t("br"),t("br"),n._v("Nói hết quay đầu: “Vị này chính là Tiềm Xung Danh Sư đường phân bộ đường chủ, Nhạc Nhất Toàn, Nhạc sư!”"),t("br"),t("br"),n._v("“Gặp qua Nhạc sư!”"),t("br"),t("br"),n._v("Nghe được vị này liền là đường chủ, Trương Huyền cùng Trương Cửu Tiêu đồng thời hướng về phía trước, thần thái cung kính."),t("br"),t("br"),n._v("“Triệu sư, mời tới bên này!”"),t("br"),t("br"),n._v("Nhìn bọn họ một cái, Nhạc Nhất Toàn cũng không để ý tới, mà là lên tiếng chào, đi đầu dẫn đường."),t("br"),t("br"),n._v("“Nếu như ta nhớ không lầm, Tống Hiên cùng hắn có quan hệ thân thích, là em vợ của hắn, phái đi Thanh Nguyên đế quốc, là muốn rèn luyện một chút, tăng lên phó đường chủ, kết quả...”"),t("br"),t("br"),n._v("Trương Cửu Tiêu truyền âm."),t("br"),t("br"),n._v("Trương Huyền hiểu được."),t("br"),t("br"),n._v("Khó trách, một điểm lễ tiết đều không có, nguyên lai đối với mình mang theo địch ý."),t("br"),t("br"),n._v("Tống Hiên làm sứ giả, tình huống bình thường, nên kiểm tra rõ ràng lại động thủ, kết quả trực tiếp muốn xử quyết Tôn Cường, Hứa trưởng lão đám người, bản thân liền có cực lớn vấn đề, chịu đến xử phạt, không gì đáng trách."),t("br"),t("br"),n._v("Bất quá, hắn bị xử lý... Không chỉ tăng lên phó đường chủ không có khả năng, vị này Nhạc đường chủ thanh danh, khẳng định cũng sẽ có dùng người không khách quan vết nhơ, khó trách không có sắc mặt tốt."),t("br"),t("br"),n._v("“Đi thôi!”"),t("br"),t("br"),n._v("Biết sự tình ra có nguyên nhân, lười nhác tiếp tục chú ý."),t("br"),t("br"),n._v("Dù sao Tiềm Xung đế quốc, chỉ là đi Thánh tử điện chỗ đặt chân, đợi không được bao lâu, đối phương thái độ được không, quan hệ không lớn."),t("br"),t("br"),n._v("Cùng lắm thì tránh né đối phương là được."),t("br"),t("br"),n._v("Danh Sư đường hẳn là trước thời hạn dọn bãi, không có nhiều người, chỉ có thể nhìn thấy đến đây nghênh tiếp rất nhiều danh sư."),t("br"),t("br"),n._v("Thấp nhất đều đạt đến thất tinh đỉnh phong, từng dãy, chừng mấy trăm nhiều."),t("br"),t("br"),n._v("“Quả nhiên nội tình thâm hậu...”"),t("br"),t("br"),n._v("Đi tại thông đạo ở giữa, Trương Huyền cảm khái."),t("br"),t("br"),n._v("Thất tinh đỉnh phong danh sư, tương đương với tu vi đạt đến Nguyên Thần cảnh đỉnh phong, loại thực lực này, tại Thanh Nguyên đế quốc có thể đếm được trên đầu ngón tay, mà ở đây, rau cải trắng đồng dạng, đầy đất tràn lan... Không hổ là thứ nhất phong hào đế quốc."),t("br"),t("br"),n._v("“Tiềm Xung đế quốc, sở dĩ mạnh mẽ, là bởi vì lưng tựa linh khoáng, linh thạch đầy đủ, lại thêm Danh Sư đường nâng đỡ, phát triển không biết bao nhiêu năm mới có như vậy quy mô!”"),t("br"),t("br"),n._v("Nhìn ra hắn khiếp sợ, Trương Cửu Tiêu truyền âm."),t("br"),t("br"),n._v("Đối liên minh đế quốc cục diện, làm đủ bài học, biết đến hết sức rõ ràng."),t("br"),t("br"),n._v("“Linh khoáng?”"),t("br"),t("br"),n._v("Trương Huyền cau mày."),t("br"),t("br"),n._v("“Ừm, nghe nói có Tiềm Xung đế quốc, có một chỗ tinh nguyên linh thạch thượng phẩm linh khoáng... Nguyên nhân chính là như vậy, mới hấp dẫn vô số cao thủ đến đây hiệu lực! Từ đó tiến hành tốt tuần hoàn, quốc lực càng ngày càng dồi dào...”"),t("br"),t("br"),n._v("Trương Cửu Tiêu gật đầu."),t("br"),t("br"),n._v("Tu luyện, tài lữ pháp địa, tài chiếm vị thứ nhất."),t("br"),t("br"),n._v("Chỉ cần có tiền, đến đây hiệu lực người, liền nhiều vô số kể, quá nhiều cao thủ, bồi dưỡng cao thủ, đương nhiên cũng liền nhiều, quốc gia mới có thể càng ngày càng cường đại."),t("br"),t("br"),n._v("Một cái đế quốc, nghèo rớt mồng tơi... Ai nguyện ý tới? Cấp bậc cao Danh Sư đường, chỉ sợ đều thành lập không nổi."),t("br"),t("br"),n._v("“Nơi này có... Tinh nguyên linh thạch thượng phẩm linh khoáng?” Trương Huyền hô hấp dồn dập."),t("br"),t("br"),n._v("“Đúng vậy a, dường như cái khác mấy đại đế quốc lưu thông tinh nguyên linh thạch thượng phẩm, đều là từ nơi này đi ra!” Trương Cửu Tiêu gật đầu."),t("br"),t("br"),n._v("“Nếu như ta muốn kiếm lấy loại linh thạch này, nên đi đâu?”"),t("br"),t("br"),n._v("Trương Huyền vội vàng hỏi."),t("br"),t("br"),n._v("Hắn vừa vặn thiếu linh thạch tăng cao tu vi, nơi này đã có linh mạch lời nói, dùng để giao dịch linh thạch cũng sẽ nhiều, hoàn toàn có thể nghĩ biện pháp kiếm lấy, cũng không cần giống như trước đó như thế, bớt ăn bớt mặc."),t("br"),t("br"),n._v("“Cái này ta không biết, bất quá... Nghe nói Tiềm Xung đế quốc, có lòng đất chợ đen, trong đó có tinh nguyên linh thạch thượng phẩm lưu thông, hơn nữa số lượng không ít, nếu như cần, có thể đi qua nhìn một chút...”"),t("br"),t("br"),n._v("Suy nghĩ một chút, Trương Cửu Tiêu nói: “Bất quá, những tin tức này, ta cũng là tin đồn, cụ thể làm sao cũng không rõ ràng!”"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1261"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1263"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);